//Scrolls Time/Date/Temp below home-screen banner
void LCDScrollDisplay(void){
	char ScrollLine[21];
	char Time[8];
	char Date[8];
	float Temp;
	int i = 0;

	i2c_init(); //Set bit rate and clock, etc
	rtc_time CurrentTime; //Time result struct
	rtc_time * Time_Addr = &CurrentTime;
	ST7735_FillScreen(0); //Fill bkgd black
	ST7735_DrawBitmap(0,27,Clouds,128,28); //Draw clouds top
	ST7735_SetCursor(0,3);
	//Get time result values into display array
	ScrollLine[0] = (CurrentTime.hour / 10) + 48;
	ScrollLine[1] = CurrentTime.hour % 10 + 48;
	ScrollLine[2] =  ' ';
	ScrollLine[3] = CurrentTime.min / 10 + 48;
	ScrollLine[4] = CurrentTime.min % 10 + 48;
	ScrollLine[5] = ' ';
	ScrollLine[6] = CurrentTime.sec / 10 + 48;
	ScrollLine[7] = CurrentTime.sec % 10 + 48;
	ScrollLine[8] = '\0'; //Terminator

	int j = 0; //counter through display array
	while( j <  20){
		ST7735_SetCursor(0,3);
		ST7735_OutString(ScrollLine);
		for(i = 20; i > 0; i--){
			ScrollLine[i] = ScrollLine[i-1];
		}
		ScrollLine[0] = ' ';
		delay_ms(100);
		j++;
	}

//	//Shifting Temp into ScrollDisplay array
	float * Temp_Addr = &Temp; //Temp result pointer
	rtc_gettemp(Temp_Addr); //read/Get current temp
	char TempCh[7]; //Temp display chars
	TempCh[0] = (int)Temp/10 + 48;
	TempCh[1] = (int)Temp%10 + 48;
	TempCh[2] = '.';
	TempCh[3] = (int)(((int)(Temp*100.0)%100)/10 + 48);
	TempCh[4] = (int)(((int)(Temp*100.0)%100)%10 + 48);
	TempCh[5] = ' ';
	TempCh[6] = 'C';

	j = 0;
	while ( j < 27){
		if( j < 7){
			ScrollLine[0] = TempCh[6-j]; //shift in temp
		}
		else{
			ScrollLine[0] = ' ';
		}
		ST7735_SetCursor(0,3);
		ST7735_OutString(ScrollLine);
		delay_ms(100); //delay before shift
		//Shift display chars
		for(i = 20; i > 0; i--){
			ScrollLine[i] = ScrollLine[i-1];
		}
		j++;
	}

//	//Shifting Date into ScrollDisplay array
	rtc_gettime(Time_Addr); //Get time/date result

	int n = 0;
	while( n < 10){ //Count chars in day of week
		if(rtc_day_name[CurrentTime.day_of_week][n] == NULL)
			break;
		n++;
	}
	while( n > 0){
		//Shift in chars of weekday name
		ScrollLine[0] = rtc_day_name[CurrentTime.day_of_week][n-1];
		ST7735_SetCursor(0,3);
		ST7735_OutString(ScrollLine);
		delay_ms(100); //shift delay
		for(i = 20; i > 0; i--){
			ScrollLine[i] = ScrollLine[i-1]; //shift array by 1
		}
		n--;
	}
	//Get Date chars
	Date[0] = (CurrentTime.year) % 10 + 48;
	Date[1] = (CurrentTime.year % 100) / 10 + 48;
	Date[2] =  ' ';
	Date[3] = CurrentTime.date % 10 + 48;
	Date[4] = CurrentTime.date / 10 + 48;
	Date[5] = ' ';
	Date[6] = CurrentTime.month % 10 + 48;
	Date[7] = CurrentTime.month / 10 + 48;
	n = 0;
	delay_ms(100); //shift delay
	while( n < 29){ //Shift in date
		if( n < 9 && n > 0){
			ScrollLine[0] = Date[n-1];
		}
		else{
			ScrollLine[0] = ' ';
		}
		ST7735_SetCursor(0,3);
		ST7735_OutString(ScrollLine); //Output current array
		delay_ms(100);
		for(i = 20; i > 0; i--){
			ScrollLine[i] = ScrollLine[i-1];
		}
		n++;
	}
}

//Flashes Alarm Indicator on Lower Screen in Red
//Designed for Home Screen View
void LCDFlashAlarm(uint8_t FlashSeconds, char Source[], int ScrollTime){
	int i, x;
	int n = 0;
	int y = 129;
	char A[] = "*ALARM*";
	rtc_time Time;
	rtc_time * Time_Addr = &Time;
	ST7735_SetCursor(0,11);
	ST7735_OutString("Trigger On: ");
	ST7735_OutString(Source);
	if( ScrollTime ){
		SetupTA1();
		Timer_A_startCounter(TIMER_A1_BASE,TIMER_A_UP_MODE); //Start Timer TA1
	}
	while( n < FlashSeconds){
		if( ScrollTime ){
			rtc_gettime(Time_Addr);
			rtc_format(Time_Addr,(char*)(&ScrollTimeStr),30);
		}
		ST7735_FillRect(0, 119, 128, 40, ST7735_RED);
		delay_ms(500);
		x = 22;
		for(i = 0; i < 7; i++){
			ST7735_DrawChar(x, y, A[i], ST7735_YELLOW, 0, 2);
			x += 12;
		}
		delay_ms(500);
		n++;
	}
}

//Helper fn for LCDFlashAlarm(), sets up TA1 to scrolltime on interrupt
//Assumes ACLK at 8KHz and REF0 clk at 32 KHz,Does not start TA1
void SetupTA1(void){
	Interrupt_enableMaster(); //Enable interrupts
	//Set-up Scroll 1 char right config
	Timer_A_UpModeConfig TimerA1Config = {
		TIMER_A_CLOCKSOURCE_ACLK,
		TIMER_A_CLOCKSOURCE_DIVIDER_1,
		800,
		TIMER_A_TAIE_INTERRUPT_ENABLE,
		TIMER_A_CCIE_CCR0_INTERRUPT_DISABLE,
		TIMER_A_DO_CLEAR
	};
	Timer_A_configureUpMode(TIMER_A1_BASE,&TimerA1Config); //Config TA0 with period
	//Register interrupt on OF for TA0
	Timer_A_registerInterrupt(TIMER_A1_BASE,TIMER_A_CCRX_AND_OVERFLOW_INTERRUPT,TA1_0_IRQHandler);
	Interrupt_enableInterrupt(INT_TA1_0); //Enable Scroll Interrupt Timer
}

void LCDStartup(void){
	Output_Init();
	ST7735_DrawBitmap(0,159,GuardDog,128,160);
	delay_ms(3000);
}


void TA1_0_IRQHandler(void){
	if( *(Fmt_Time_Ptr - 1) > 31 && *(Fmt_Time_Ptr - 1) < 123 ){
		Fmt_Time_Ptr--;
	}
	else{
		Fmt_Time_Ptr = (char *)(&ScrollTimeStr[29]);
	}
	ST7735_SetCursor(0,3);
	ST7735_OutString(Fmt_Time_Ptr);
	Timer_A_stopTimer(TIMER_A1_BASE);
	Timer_A_clearTimer(TIMER_A1_BASE);
	Timer_A_clearInterruptFlag(TIMER_A1_BASE);
	Timer_A_startCounter(TIMER_A1_BASE,TIMER_A_UP_MODE);
}
